/******/ (() => { // webpackBootstrap
/******/ 	"use strict";
/*!********************!*\
  !*** ./js/main.ts ***!
  \********************/

var student1 = {
    firstName: 'Robin',
    lastName: 'David',
    age: 27,
    location: 'Astille',
};
var student2 = {
    firstName: 'Johnny',
    lastName: 'Silverhand',
    age: 34,
    location: 'Nightcity',
};
var studentsList = [student1, student2];
// Création dynamique du tableau HTML
var table = document.createElement('table');
var thead = document.createElement('thead');
var headerRow = document.createElement('tr');
//création des en-tête
var thFirstName = document.createElement('th');
thFirstName.textContent = 'First Name';
var thLocation = document.createElement('th');
thLocation.textContent = 'Location';
headerRow.appendChild(thFirstName);
headerRow.appendChild(thLocation);
thead.appendChild(headerRow);
table.appendChild(thead);
// Corps du tableau
var tbody = document.createElement('tbody');
studentsList.forEach(function (student) {
    var row = document.createElement('tr');
    var tdFirstName = document.createElement('td');
    tdFirstName.textContent = student.firstName;
    var tdLocation = document.createElement('td');
    tdLocation.textContent = student.location;
    row.appendChild(tdFirstName);
    row.appendChild(tdLocation);
    tbody.appendChild(row);
});
table.appendChild(tbody);
// 5. Ajout du tableau au corps de la page
document.body.appendChild(table);

/******/ })()
;
